// importing various folders/libraries to use here
import React, {Component} from "react";
import "./bAndA.css";
import Before2 from "../../assets/before2.png";
import After2 from "../../assets/after2.png";


class BAndA2 extends Component {
  render() {
  return (
    <section className="grid">

      <div className="gridArea">
        <div className="before"
        style={{ backgroundImage: `url(${Before2})` }}>
          <p className="textBefore">Before</p>
          <p className="textWord1"> Design</p>
        </div>

        <div className="after1"
        style={{ backgroundImage: `url(${After2})` }}>
       <p className="textAfter1">After</p>
        </div>
      </div>

    </section>
  );
}
}

export default BAndA2;
